function countCompleteSubstrings(word: string, k: number): number {
    let count = 0;
    for (let start = 0; start < word.length; start++) {
        let charCount: {[key: string]: number} = {};
        let maxChar = '';
        for (let end = start; end < word.length; end++) {
            const char = word[end];
            charCount[char] = (charCount[char] || 0) + 1;
            if (!maxChar || charCount[char] > charCount[maxChar]) {
                maxChar = char;
            }
            if (charCount[maxChar] > k) break;
            let isValid = true;
            Object.keys(charCount).forEach(c => {
                if (charCount[c] !== k) {
                    isValid = false;
                }
                if (Math.abs(c.charCodeAt(0) - maxChar.charCodeAt(0)) > 2) {
                    isValid = false;
                }
            });
            if (isValid && Object.keys(charCount).length * k === end - start + 1) {
                count++;
            }
        }
    }
    return count;
};
